import React from 'react';
import './Testimonials.css';

const Testimonials = () => {
  return (
    <section className="testimonials">
      <h2>What Our Clients Say</h2>
      <div className="testimonial-item">
        <p>
          "TechSaaS Vision transformed our digital presence with a
          modern, responsive website that has significantly boosted
          our engagement."
        </p>
        <h4>John Doe, CEO of Example Co.</h4>
      </div>
    </section>
  );
};

export default Testimonials;
